const Lato100 = `@font-face { font-family: 'Lato'; font-style: normal; font-weight: 100; src: local('Lato Hairline'), local('Lato-Hairline'), url('data:font/woff2;base64,') format('woff2'); }`;
const Lato100italic = `@font-face { font-family: 'Lato'; font-style: italic; font-weight: 100; src: local('Lato Hairline Italic'), local('Lato-HairlineItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Lato300 = `@font-face { font-family: 'Lato'; font-style: normal; font-weight: 300; src: local('Lato Light'), local('Lato-Light'), url('data:font/woff2;base64,') format('woff2'); }`;
const Lato300italic = `@font-face { font-family: 'Lato'; font-style: italic; font-weight: 300; src: local('Lato Light Italic'), local('Lato-LightItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const LatoRegular = `@font-face { font-family: 'Lato'; font-style: normal; font-weight: 400; src: local('Lato Regular'), local('Lato-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const LatoItalic = `@font-face { font-family: 'Lato'; font-style: italic; font-weight: 400; src: local('Lato Italic'), local('Lato-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Lato700 = `@font-face { font-family: 'Lato'; font-style: normal; font-weight: 700; src: local('Lato Bold'), local('Lato-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Lato700italic = `@font-face { font-family: 'Lato'; font-style: italic; font-weight: 700; src: local('Lato Bold Italic'), local('Lato-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Lato900 = `@font-face { font-family: 'Lato'; font-style: normal; font-weight: 900; src: local('Lato Black'), local('Lato-Black'), url('data:font/woff2;base64,') format('woff2'); }`;
const Lato900italic = `@font-face { font-family: 'Lato'; font-style: italic; font-weight: 900; src: local('Lato Black Italic'), local('Lato-BlackItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
